import React from 'react';
//import logo from './logo.svg';
import './App.css';
import './Mobile.css';

function App() {
  return (


    <div className="container-fluid">
      <nav id="navbar-example" class="navbar navbar-default navbar-fixed-top" role="navigation">
        <div class="container">
          <div class="navbar-header">
            <button type="button" class="navbar-toggle" data-toggle="collapse" data-target=".bs-js-navbar-scrollspy">
              <span class="sr-only">切换导航</span>
              <span class="icon-bar"></span>
              <span class="icon-bar"></span>
              <span class="icon-bar"></span>
              <span class="icon-bar"></span>
            </button>
            <a href="#home" class="navbar-brand nav-title">YinyouPoet</a>
          </div>
          <div class="collapse navbar-collapse bs-js-navbar-scrollspy">
            <ul class="nav navbar-nav navbar-right">
              <li class="cative"><a href="#home">Home</a></li>
              <li class="cative"><a href="#about">About</a></li>
              <li class="cative"><a href="#portfolio">Portfolio</a></li>
              <li class="cative"><a href="#contact">Contact</a></li>
            </ul>
          </div>
        </div>
      </nav> 

      <div data-spy="scroll" data-target="#navbar-example" data-offset="100" id="page-content" style="position: relative;overflow-y: scroll;"></div>
      {/* <!--img src={logo}
            data-src-600px="image-600px.jpg"
            data-src-800px="image-800px.jpg"
            alt=""></img--> */}

    </div>

  );
}

export default App;
